Et je ne suis pas sûr que ça soit une bonne chose pour tous.

@Ayk0Sama @Pokekalos Il y a absolument Aucune ressemblance avec Canarticho et Flamiaou et Kaiminus.

Et parler de sortie alors que le jeu n'a aucune date d'annoncer faut vraiment être teubé.

